%spark
val numberOfFactors = 1;
val numberOfPaths = 10000;
val seed = 31415;
val initialValue = 1.0;
val riskFreeRate = z.input("risk free rate", "0.05").toString.toDouble;
val volatility = z.input("volatility", "0.25").toString.toDouble;

var timeDiscretization = new net.finmath.time.TimeDiscretization(0.0, 20, 0.25);
var brownianMotion = new net.finmath.montecarlo.BrownianMotion(timeDiscretization, numberOfFactors, numberOfPaths, seed);
var model = new net.finmath.montecarlo.assetderivativevaluation.BlackScholesModel(initialValue, riskFreeRate, volatility);
var process = new net.finmath.montecarlo.process.ProcessEulerScheme(brownianMotion);
var simulation = new net.finmath.montecarlo.assetderivativevaluation.MonteCarloAssetModel(model, process);

var value1 = simulation.getAssetValue(1.0, 0);
var value2 = simulation.getAssetValue(2.0, 0);

case class Data(path: Integer, time: Double, value: Double);
val valueDataFrame = Range(0, timeDiscretization.getNumberOfTimes()).map(j => 
 Range(0,numberOfPaths).map(i => (j,i))).flatten.map(x => {var path = x._2; var timeIndex = x._1; Data(path, timeDiscretization.getTime(timeIndex), simulation.getAssetValue(timeDiscretization.getTime(timeIndex), 0).get(path))}).toDF("path", "time", "value");
valueDataFrame.registerTempTable("values");

case class HistData(path: Integer, time: Double, center: Double, fequency: Double);

val valueHistDataFrame = Range(1, timeDiscretization.getNumberOfTimes()).map(timeIndex => (timeDiscretization.getTime(timeIndex), simulation.getAssetValue(timeDiscretization.getTime(timeIndex),0).getHistogram(50, 3.0))).map(x => Range(0,x._2(0).length).map(index => HistData(0, x._1, x._2(0)(index), x._2(1)(index)))).flatten.toDF("index", "time", "center", "value");
valueHistDataFrame.registerTempTable("valueHistDataFrame");
val timeList = timeDiscretization.getAsDoubleArray().map(x => (x.toString,x.toString)).toIterable;
